import React from 'react';
import { InlineWidget } from 'react-calendly';
import './Calendar.css';

function Calendar() {
  return (
    <div className="calendar-page">
      <div className="calendar-container">
        <h1>Book Your Training Session</h1>
        <div className="calendar-content">
          <div className="calendar-box">
            <InlineWidget 
              url="https://calendly.com/firsttouchsoccer"
              styles={{
                height: '700px',
                width: '100%'
              }}
            />
          </div>
          <div className="booking-info">
            <h3>Booking Information</h3>
            <ul>
              <li>Sessions are 1 hour long</li>
              <li>Available Monday through Saturday</li>
              <li>Morning and afternoon slots available</li>
              <li>Individual and group sessions</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Calendar;
